				<section class="elementor-section elementor-inner-section elementor-element elementor-element-0eab477 animated-slow elementor-section-boxed elementor-section-height-default elementor-section-height-default elementor-invisible" data-id="0eab477" data-element_type="section" data-settings="{&quot;animation&quot;:&quot;fadeInUp&quot;}">
						<div class="elementor-container elementor-column-gap-default">
					
						<div class="elementor-column elementor-col-50 elementor-inner-column elementor-element elementor-element-3688223" data-id="3688223" data-element_type="column">
			<div class="elementor-widget-wrap elementor-element-populated">
								<div class="elementor-element elementor-element-22a5cd8 elementor-widget elementor-widget-jkit_accordion" data-id="22a5cd8" data-element_type="widget" data-widget_type="jkit_accordion.default">
				<div class="elementor-widget-container">
			<div class="jeg-elementor-kit jkit-accordion style-default jeg_module_588_2_6375fd3f376e7"><div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-112c66f" class="card-header-button" aria-expanded="false" data-target="#expand-112c66f" aria-controls="expand-112c66f">
                        <span class="title">Who can learn?</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-112c66f" style="display:none"><div class="card-body" style="color:#282828;" >Absolutely anybody! Our paragliding courses are available for anyone over the age of 16 with a basic level of physical fitness and no medically prescribed restrictions.</div></div>
            </div>
			
			
			
			<div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-b86f4ad" class="card-header-button" aria-expanded="false" data-target="#expand-b86f4ad" aria-controls="expand-b86f4ad">
                        <span class="title">Do I have to be a daredevil or adventure junkie?</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-b86f4ad" style="display:none"><div class="card-body" style="color:#282828;" >Absolutely not! Paragliding is a gentle sport. All you need is desire to fly and positive attitude.

</div></div>
            </div>
			
			

			<div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-b86f4ad" class="card-header-button" aria-expanded="false" data-target="#expand-b86f4ad" aria-controls="expand-b86f4ad">
                        <span class="title">I am concerned about safety!</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-b86f4ad" style="display:none"><div class="card-body" style="color:#282828;" >We understand that. But you don't have to worry about it, cause we are concerned about your safety. We make sure you practice under our supervision only when the conditions are suitable for your level. As a precaution First-aid is available at the site just in case. We do advise you to have an insurance policy covering adventure sports.

</div></div>
            </div>

			
			<div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-b86f4ad" class="card-header-button" aria-expanded="false" data-target="#expand-b86f4ad" aria-controls="expand-b86f4ad">
                        <span class="title">Is Paragliding recognized sport in India?
</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-b86f4ad" style="display:none"><div class="card-body" style="color:#282828;" >Not yet!. Efforts are ongoing to get the sport recognized by the Government. But there is no recognized governing body or recognized institution controlling the sport.

Yet! India has organized Paragliding World Cup, we have pilots who have won podium finishes in International Paragliding competitions and our armed forces practice paragliding for years. Indus Paragliding is proud to have trained pilots from Indian Air Force, Indian Army, Indian Navy and Indian Coast Guard.



</div></div>
            </div>

			<div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-b86f4ad" class="card-header-button" aria-expanded="false" data-target="#expand-b86f4ad" aria-controls="expand-b86f4ad">
                        <span class="title">Do I need permission to fly in India or abroad?
</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-b86f4ad" style="display:none"><div class="card-body" style="color:#282828;" >There are specific regulations set by local authorities in many region for better coordination with the nearest ATC (Air Traffic Controller), Regional Civic Authorities and Law Enforcement Agencies. We strongly support such initiatives and suggest all to abide by the local regulations if any. When flying abroad consult the school or the federation in the region for specific regulations.



</div></div>
            </div>

			<div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-b86f4ad" class="card-header-button" aria-expanded="false" data-target="#expand-b86f4ad" aria-controls="expand-b86f4ad">
                        <span class="title">Will you rent out your equipment?
</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-b86f4ad" style="display:none"><div class="card-body" style="color:#282828;" >Our equipment are used for training purpose. We will rent out equipment to our certified students if they continue to practice the sport. If you have learnt with us and have not flown for a long period, we advise you to take up a refresher course in order to use our equipment and fly.



</div></div>
            </div>

		
		
		
		
		
		</div>		</div>
				</div>
					</div>
		</div>
				<div class="elementor-column elementor-col-50 elementor-inner-column elementor-element elementor-element-515608d" data-id="515608d" data-element_type="column">
			<div class="elementor-widget-wrap elementor-element-populated">
								<div class="elementor-element elementor-element-b4d63d9 elementor-widget elementor-widget-jkit_accordion" data-id="b4d63d9" data-element_type="widget" data-widget_type="jkit_accordion.default">
				<div class="elementor-widget-container">
			<div class="jeg-elementor-kit jkit-accordion style-default jeg_module_588_3_6375fd3f38b40"><div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-112c66f" class="card-header-button" aria-expanded="false" data-target="#expand-112c66f" aria-controls="expand-112c66f">
                        <span class="title">Do I have to buy the equipment for learning?</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-112c66f" style="display:none"><div class="card-body" style="color:#282828;" >No. We will provide you all necessary equipment for ground training and flying tasks during the training period.

</div></div>
            </div>
			
			<div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-b86f4ad" class="card-header-button" aria-expanded="false" data-target="#expand-b86f4ad" aria-controls="expand-b86f4ad">
                        <span class="title">Will I get a Pilot License on completion of the course?</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-b86f4ad" style="display:none"><div class="card-body" style="color:#282828;" >First of all...there is no need for any license to fly a paraglider. Also there is no recognized licensing authority yet in India. We will provide you a certificate on completion of your course.
</div></div>
            </div>
			
			

			<div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-b86f4ad" class="card-header-button" aria-expanded="false" data-target="#expand-b86f4ad" aria-controls="expand-b86f4ad">
                        <span class="title">When can I fly on my own?</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-b86f4ad" style="display:none"><div class="card-body" style="color:#282828;" >After initial ground training, the very first flight you take is a solo flight. So technically you are flying on your own from the very first flight, but under direct supervision of a professional. To be able to fly totally on your own requires you to complete two courses P1 and P2, plus a few additional hours of flying under supervision to gain more experience and confidence.
</div></div>
            </div>

			<div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-b86f4ad" class="card-header-button" aria-expanded="false" data-target="#expand-b86f4ad" aria-controls="expand-b86f4ad">
                        <span class="title">Do you want me to buy equipment from you?
</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-b86f4ad" style="display:none"><div class="card-body" style="color:#282828;" >When you are ready to purchase your own equipment we can help you to decide on the right equipment. Indus Paragliding is authorized dealer for some top-notch reputed equipment manufacturers like - Niviuk, Ozone, Supair, Icaro Sky Helmets and more. However you are free to buy your equipment from any authorized dealer in the country.


</div></div>
            </div>
			<div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-b86f4ad" class="card-header-button" aria-expanded="false" data-target="#expand-b86f4ad" aria-controls="expand-b86f4ad">
                        <span class="title">Am I restricted to fly with Indus only?
</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-b86f4ad" style="display:none"><div class="card-body" style="color:#282828;" >Our mission is to make you a thinking - free flying pilot and not a 'caged bird'. You are always welcome to fly with us, but are not at all restricted to only fly with us. We encourage you to network with other pilots in your region and other parts of the world and share, learn experiences and joy of this wonderful sport. This simple philosophy of Indus Paragliding has kept us soaring high for 10+ years.


</div></div>
            </div>
			<div class="card-wrapper ">
                <div class="card-header">
                    <a href="#expand-b86f4ad" class="card-header-button" aria-expanded="false" data-target="#expand-b86f4ad" aria-controls="expand-b86f4ad">
                        <span class="title">Do I have to join any federation/association?
</span><div class="right-icon-group">
                <div class="normal-icon"><i aria-hidden="true" class="fas fa-chevron-down"></i></div>
                <div class="active-icon"><i aria-hidden="true" class="fas fa-chevron-up"></i></div>
            </div>
                    </a>
                </div>
                <div class="card-expand" id="expand-b86f4ad" style="display:none"><div class="card-body" style="color:#282828;" >Not necessary. But you are encouraged to support genuine association like PAI (Paragliding Association of India) for its good work since 2010 for the sport in the country on National level. You can also support non-commercial and non-political local/regional associations.


</div></div>
            </div>

			









			
		
		
		</div>		</div>
				</div>
					</div>
		</div>
							</div>
		</section>
					</div>
		</div>
							</div>
		</section>


		
				
				
							</div>
